import React from "react";
import { useState } from "react";
import moon from "../../images/moon.png";
import {
  RevealButton1,
  RevealButton2,
  RevealButton3,
  RevealButton4,
  RevealButton5,
} from "../utils/RevealSkills";

const Skills = () => {
  const [moon, setMoon] = useState({ left: 10, top: 2 });

  const moonHandler = (event) => {
    let newMoon = { ...moon };
    // const beep = moon.left + 1
    // console.log(beep);
    newMoon.left = moon.left + 1;
    newMoon.top = moon.top + 1;
    console.log(newMoon);
    setMoon(newMoon);
    console.log(moon);
  };

  return (
    <div className="grid md:grid-cols-[1fr_2fr] px-10 md:px-20 mt-20 mb-40 md:my-40 ">
      <div className="flex justify-center pb-20 md:pb-3 ">
        <div
          className={`absolute w-40 h-40 bg-moonlight rounded-full -ml-20 -mt-10`}
        />
        <div className=" w-40 h-40 bg-white rounded-full" />
      </div>
      <div className="">
        <div className="">
          <h2 className="text-2xl ml-40 w-100 text-right border-b border-white leading-4 mb-10 h-2">
            <span className="bg-moonlight md:bg-darkblue pl-4">SKILLS</span>
          </h2>
        </div>
        <div className="flex gap-3 flex-wrap justify-end z-10">
          <RevealButton1>
            <button
              onClick={moonHandler}
              className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
            >
              Bootstrap
            </button>
          </RevealButton1>
          <RevealButton2>
            <button
              onClick={moonHandler}
              className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
            >
              CSS Tailwind
            </button>
          </RevealButton2>
          <RevealButton3>

          </RevealButton3>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            React
          </button>
          <RevealButton3>
            <button
              onClick={moonHandler}
              className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
            >
              HTML
            </button>
          </RevealButton3>
          <RevealButton4>
            <button
              onClick={moonHandler}
              className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
            >
              Material UI
            </button>
          </RevealButton4>
          <RevealButton5>
            <button
              onClick={moonHandler}
              className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
            >
              Node.js
            </button>
          </RevealButton5>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            Next.js
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            React
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            HTML
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            Node.js
          </button>
        </div>
      </div>
    </div>
  );
};

export default Skills;
